As models we never really tell y’all weeks and days we be sweating bricks for a show, shoot or band launch so we can sell the product but most importantly the CONFIDENCE IN OURSELVES.

I asked the ladies what do they do to prepare for launch day, how do they feel about their bodies and who they represent when they hit the stage.

These days we realize representation is more important than anything and so some of the ladies who modeled for @vidabyesquire had abit to say.

So if you’re feeling abit self conscious or scared no worries we feel the same too so WEAR THAT COSTUME, WEAR THAT LINGERIE, WEAR THAT BIKINI!

