A HUGE part of human expression, social interactions and life is heavily dependent on CULTURAL IDENTITY.

So for this post I’m going to calmly take off my dancer hat and put on my Psychology and Sociology academic training hat in human behavior. Oistins Fish Festival stays true to the authenticity of bajan culture by its literal rawness, parties at night and just the DIRECT personalities of Bajan people you will meet on the street.

This has shaped our cultural identity as Barbadians tremendously and I hope the festival stays ALIVE!

Thanks to the @oistinsfishfestival committee is to be apart of their Celebrity Cook Off! We had so much fun stay tuned for Part 2! 

